// Core
import React, { Component } from 'react';

// Components
import { Tracker } from './Tracker';
import { Animals } from './Animals';

const Content = (props) => {
    return (
        <>
            <Animals.Cat { ...props } />
            <Animals.Mouse { ...props } />
            <Animals.Tile { ...props } />
        </>
    );
};

export class Room extends Component {
    render() {
        return (
            <div className = 'room'>
                <h1>Поиграем в кошки-мышки!</h1>
                <Tracker component = { Content } />
            </div>
        );
    }
}
